import './App.css'
const logo = "data:image/gif;base64,"
import {DownloadVideo} from "../wailsjs/go/main/App";
import {useState} from "preact/hooks";
import {Fragment, h} from 'preact';

export function App() {
    const [resultText, setResultText] = useState("Please enter your name below 👇");
    const [image, setImage] = useState(logo);
    const [name, setName] = useState('');
    const updateName = (e: any) => setName(e.target.value);
    function updateResultText(result: any) {
        setResultText(result.title)
        setImage(result.thumbnail);
    }

    function greet() {
        DownloadVideo(name).then(updateResultText);
    }

    return (
        <Fragment>
            <div id="App">
                <img src={image} id="logo" alt="logo"/>
                <div id="result" className="result">{resultText}</div>
                <div id="result" className="result">I am in preact hell</div>
                <div id="input" className="input-box">
                    <input id="name" className="input" onChange={updateName} autoComplete="off" name="input" type="text"/>
                    <button className="btn" onClick={greet}>Greet</button>
                </div>
            </div>
        </Fragment>
    )
}
